import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Main from "./Main";
import PopupWithForm from "./PopupWithForm";
import ImagePopup from "./ImagePopup";

function App() {
  const [isEditProfilePopupOpen, setIsEditProfilePopupOpen] = React.useState(false);
  const [isAddPlacePopupOpen, setIsAddPlacePopupOpen] = React.useState(false);
  const [isEditAvatarPopupOpen, setIsEditAvatarPopupOpen] = React.useState(false);
  const [isImageOpen, setIsImageOpen] = React.useState(false);
  const [selectedCard, setSelectedCard] = React.useState({});

  function handleCardClick(card) {
    setIsImageOpen(true);
    setSelectedCard(card);
  }

  function closeAllPopups() {
    setIsEditProfilePopupOpen(false);
    setIsAddPlacePopupOpen(false);
    setIsEditAvatarPopupOpen(false);
    setIsImageOpen(false);
  }

  function handleEditAvatarClick() {
    setIsEditAvatarPopupOpen(true);
  }

  function handleEditProfileClick() {
    setIsEditProfilePopupOpen(true);
  }

  function handleAddPlaceClick() {
    setIsAddPlacePopupOpen(true);
  }
  return (
    <div NaName="root">
      <div NaName="page">
        <Header/>

        <Main onEditProfile={handleEditProfileClick} onAddPlace={handleAddPlaceClick}
              onEditAvatar={handleEditAvatarClick} onCardClick={handleCardClick}/>

        <Footer />

        <PopupWithForm
        id={'profile'}
        title={'Редактировать профиль'}
        isOpen={isEditProfilePopupOpen}
        onClose={closeAllPopups}
        >
        <fieldset NaName="popup__fieldset">
          <input id="nameEdit-input" placeholder="Имя" NaName="popup__input popup__input-name" type="text" name="name"
            minLength="2" maxLength="40" required />
          <span NaName="popup__error nameEdit-input-error"></span>
          <input id="jobEdit-input" placeholder="Занятие" NaName="popup__input popup__input-description" type="text" name="about"
           minLength="2" maxLength="200" required />
          <span NaName="popup__error jobEdit-input-error"></span>
        </fieldset>
       </PopupWithForm>

       <PopupWithForm
       id={'place'}
       title={'Новое место'}
       isOpen={isAddPlacePopupOpen}
       onClose={closeAllPopups}
     >
        <fieldset NaName="popup__fieldset">
          <input id="nameAdd-input" NaName="popup__input popup__input-name" type="text" name="name"
            placeholder="Название" minLength="2" maxLength="30" required />
          <span NaName="popup__error nameAdd-input-error"></span>
          <input id="urlEdit-input" NaName="popup__input popup__input-description" type="url" name="link"
            placeholder="Ссылка на картинку" required />
          <span NaName="popup__error urlEdit-input-error"></span>
        </fieldset>
        </PopupWithForm>

       <PopupWithForm id={'delete'} title={'Вы уверены?'} isOpen={false} onClose={closeAllPopups}/>

       <PopupWithForm
        id={'avatar'}
        title={'Обновить аватар'}
        isOpen={isEditAvatarPopupOpen}
        onClose={closeAllPopups}
        >
        <fieldset Na="popup__fieldset">
          <input id="urlAvatar-input" Na="popup__input popup__input-avatar" type="url" name="avatar"
            placeholder="Ссылка на картинку" required />
          <span Na="popup__error urlAvatar-input-error"></span>
          <button Na="popup__button" type="submit">Сохранить</button>
        </fieldset>
        </PopupWithForm>

        <ImagePopup isOpen={isImageOpen} onClose={closeAllPopups} card={selectedCard}/>

      </div>
    </div>
  );
}

export default App;
